import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import ExamService from '../services/ExamService';

const ExamResults = () => {
    const { examId } = useParams();
    const navigate = useNavigate();
    const { user } = useAuth();
    const [results, setResults] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        // Check if user is logged in and is a teacher
        if (!user) {
            navigate('/login');
            return;
        }

        if (user.role !== 'teacher') {
            navigate('/student-dashboard');
            return;
        }

        const fetchResults = async () => {
            try {
                setLoading(true);
                const data = await ExamService.getExamResults(examId);
                console.log('Exam results data:', data);

                // Ensure statistics object exists
                if (!data.statistics) {
                    data.statistics = {
                        passed: 0,
                        failed: 0,
                        notSubmitted: 0,
                        passRate: '0%'
                    };
                }

                setResults(data);
                setError('');
            } catch (err) {
                console.error('Error fetching results:', err);
                setError('Failed to load exam results. Please try again.');
            } finally {
                setLoading(false);
            }
        };

        fetchResults();
    }, [examId, navigate, user]);

    // Render functions for student data
    const renderStudentName = (submission) => {
        if (!submission.student) return 'Unknown Student';

        const firstName = submission.student.firstName || '';
        const lastName = submission.student.lastName || '';

        if (!firstName && !lastName) return 'Unknown Student';
        return `${firstName} ${lastName}`.trim();
    };

    const renderStudentEmail = (submission) => {
        if (!submission.student) return '';
        return submission.student.email || '';
    };

    if (loading) {
        return (
            <div className="min-h-screen bg-gray-50 flex items-center justify-center">
                <div className="spinner-border text-primary" role="status">
                    <span className="sr-only">Loading...</span>
                </div>
            </div>
        );
    }

    if (error) {
        return (
            <div className="min-h-screen bg-gray-50 flex items-center justify-center">
                <div className="bg-white p-8 rounded-lg shadow-md max-w-md w-full">
                    <h2 className="text-2xl font-bold text-gray-800 mb-4">Error</h2>
                    <p className="text-red-600">{error}</p>
                    <button
                        onClick={() => navigate('/teacher-dashboard')}
                        className="mt-6 bg-blue-600 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
                    >
                        Back to Dashboard
                    </button>
                </div>
            </div>
        );
    }

    if (!results) {
        return (
            <div className="min-h-screen bg-gray-50 flex items-center justify-center">
                <div className="bg-white p-8 rounded-lg shadow-md max-w-md w-full">
                    <h2 className="text-2xl font-bold text-gray-800 mb-4">No Results</h2>
                    <p className="text-gray-700">No results found for this exam.</p>
                    <button
                        onClick={() => navigate('/teacher-dashboard')}
                        className="mt-6 bg-blue-600 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
                    >
                        Back to Dashboard
                    </button>
                </div>
            </div>
        );
    }

    // Ensure statistics object exists
    const statistics = results.statistics || {
        passed: 0,
        failed: 0,
        notSubmitted: 0,
        passRate: '0%'
    };

    return (
        <div className="min-h-screen bg-gray-50 py-8 px-4 sm:px-6 lg:px-8">
            <div className="max-w-4xl mx-auto">
                <div className="bg-white shadow-md rounded-lg overflow-hidden">
                    <div className="px-6 py-4 border-b border-gray-200">
                        <h1 className="text-2xl font-bold text-gray-900">{results.examTitle || 'Exam'} - Results</h1>
                    </div>

                    <div className="p-6">
                        <div className="grid grid-cols-1 md:grid-cols-4 gap-4 mb-6">
                            <div className="bg-blue-50 p-4 rounded-lg text-center">
                                <p className="text-sm text-blue-600">Total Students</p>
                                <p className="text-2xl font-bold text-blue-800">{results.totalStudents || 0}</p>
                            </div>
                            <div className="bg-green-50 p-4 rounded-lg text-center">
                                <p className="text-sm text-green-600">Passed</p>
                                <p className="text-2xl font-bold text-green-800">{statistics.passed}</p>
                            </div>
                            <div className="bg-red-50 p-4 rounded-lg text-center">
                                <p className="text-sm text-red-600">Failed</p>
                                <p className="text-2xl font-bold text-red-800">{statistics.failed}</p>
                            </div>
                            <div className="bg-purple-50 p-4 rounded-lg text-center">
                                <p className="text-sm text-purple-600">Pass Rate</p>
                                <p className="text-2xl font-bold text-purple-800">{statistics.passRate}</p>
                            </div>
                        </div>

                        <h2 className="text-xl font-semibold text-gray-800 mb-4">Student Results</h2>

                        <div className="overflow-x-auto">
                            <table className="min-w-full divide-y divide-gray-200">
                                <thead className="bg-gray-50">
                                    <tr>
                                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Student</th>
                                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Score</th>
                                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Status</th>
                                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Submitted At</th>
                                    </tr>
                                </thead>
                                <tbody className="bg-white divide-y divide-gray-200">
                                    {results.submissions && results.submissions.length > 0 ? (
                                        results.submissions.map((submission, index) => (
                                            <tr key={submission._id || `submission-${index}`}>
                                                <td className="px-6 py-4 whitespace-nowrap">
                                                    <div className="text-sm font-medium text-gray-900">
                                                        {renderStudentName(submission)}
                                                    </div>
                                                    <div className="text-sm text-gray-500">
                                                        {renderStudentEmail(submission)}
                                                    </div>
                                                </td>
                                                <td className="px-6 py-4 whitespace-nowrap">
                                                    <div className="text-sm text-gray-900">{submission.totalScore || 0}</div>
                                                </td>
                                                <td className="px-6 py-4 whitespace-nowrap">
                                                    {submission.isSubmitted ? (
                                                        submission.isPassed ? (
                                                            <span className="px-2 inline-flex text-xs leading-5 font-semibold rounded-full bg-green-100 text-green-800">
                                                                Passed
                                                            </span>
                                                        ) : (
                                                            <span className="px-2 inline-flex text-xs leading-5 font-semibold rounded-full bg-red-100 text-red-800">
                                                                Failed
                                                            </span>
                                                        )
                                                    ) : (
                                                        <span className="px-2 inline-flex text-xs leading-5 font-semibold rounded-full bg-gray-100 text-gray-800">
                                                            Not Submitted
                                                        </span>
                                                    )}
                                                </td>
                                                <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                                                    {submission.submittedAt ? new Date(submission.submittedAt).toLocaleString() : 'N/A'}
                                                </td>
                                            </tr>
                                        ))
                                    ) : (
                                        <tr>
                                            <td colSpan="4" className="px-6 py-4 text-center text-sm text-gray-500">
                                                No submissions found
                                            </td>
                                        </tr>
                                    )}
                                </tbody>
                            </table>
                        </div>
                    </div>
                </div>

                <div className="mt-6">
                    <button
                        onClick={() => navigate('/teacher-dashboard')}
                        className="bg-gray-500 hover:bg-gray-600 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
                    >
                        Back to Dashboard
                    </button>
                </div>
            </div>
        </div>
    );
};

export default ExamResults;
